INSERT INTO `stockinf` VALUES (1,'1434','福懋','<p>多角化經營，主要產品有聚胺、聚酯等染整加工織物、</p>\r\n<p>純棉織物、混紡織物、長短纖交織布、</p>\r\n<p><br />各種加工機能布、短纖紗支、特殊加工織物、</p>\r\n<p>輪胎簾布、PE.塑膠袋、防彈布、阻燃傢飾布、</p>\r\n<p>碳纖維與複合材料織物及106個加油站等，<br />已成為世界長纖尼龍、聚酯多富達布產量與品質並優的主要大廠特別在運動領域高品質布材上，<br />最大客戶多年來均為Nike、adidas等世界名牌大企業，</p>\r\n<p>與潮流時尚同步發展。</p>','stocklogo/1434.png'),(2,'1435','中福','<p>前身為<strong>中福</strong>振業<strong>股份有限公司</strong>，</p>\r\n<p>於2010年更為現名。&nbsp;</p>\r\n<p><strong>公司</strong>主要營業項目為植物工廠、酒類商品、</p>\r\n<p>鞄件事業及租賃倉儲業務。</p>\r\n<p>倉儲租賃業務佔<strong>公司</strong>營收比重約90%，</p>\r\n<p>酒類收入、植物工廠、鞄件等事業合佔營收比重約10%。</p>','stocklogo/1435.png'),(3,'1437','勤益','<p><strong>公司</strong>成立於1952年，</p>\r\n<p>總部位於台北市，</p>\r\n<p>前稱為「<strong>勤益股份有限公司</strong>」，</p>\r\n<p>1988年上市掛牌交易，</p>\r\n<p>2015年2月13日更名為現名。</p>\r\n<p>2016年，<strong>公司</strong>從電源管理元件的製造代工轉型為電源管理元件的銷售，</p>\r\n<p>封裝與測試之生產已委託移轉設備的合作對象進行委外代工。</p>','stocklogo/1437.png'),(4,'1438','三地開發','<p>前身為裕豐國際<strong>開發</strong>股份有限公司成立於1955年10月11日，</p>\r\n<p>原從事紡織纖維業業，2010年暫停紡紗業務，</p>\r\n<p>並逐步轉型從事營建土地<strong>開發</strong>業務。</p>\r\n<p>2019年9月，南部知名建設公司<strong>三地</strong>集團宣布入主裕豐，</p>\r\n<p>並公告2020年9月21日變更為現名。</p>','stocklogo/1438.png'),(5,'1439','中和羊毛','<p><strong>公司</strong>成立於1964年10月，</p>\r\n<p>主要業務為毛條、防縮毛條、防縮散毛，</p>\r\n<p>近年來因台灣紡織產業外移，</p>\r\n<p>及中國大陸、印度等生產擴張迅速，</p>\r\n<p>國際市場極度競爭，致使<strong>羊毛</strong>本業連年虧損，</p>\r\n<p><strong>公司</strong>已逐漸淡出<strong>羊毛</strong>事業之營運，轉型為三角貿易經營及廠房/不動產租賃。</p>','stocklogo/1439.png'),(6,'1440','台南紡織','<p>公司成立於1955年，</p>\r\n<p>是國內最大的聚酯棉與紡紗廠。</p>\r\n<p>主要生產化纖產品有聚酯粒，聚酯棉，聚酯絲，聚酯加工絲。</p>\r\n<p>除了持續拓展並分散市場風險外，</p>\r\n<p>還提升紡紗品質及研發各類功能性紗種。</p>','stocklogo/1440.png'),(7,'1442','名軒開發','<p><strong>名軒開發</strong>成立於1974年，</p>\r\n<p>從事成衣外銷起家，</p>\r\n<p>在經濟快速起飛、商人將本求利的年代，</p>\r\n<p><strong>名軒開發</strong>卻反向思索：如何取之社會、用之社會。</p>\r\n<p>為此，經營團隊多次縝密會議、經由顧及國家利益與企業道義之下，</p>\r\n<p><strong>名軒開發</strong>毅然投入營建業，因為「建設」是提升人民品味素質與國家競爭力的重要關鍵。</p>','stocklogo/1442.png'),(8,'1443','立益紡織','<p><strong>立益</strong>集團自西元一九七二年成立以來，</p>\r\n<p>秉持著誠信篤實的企業作風，</p>\r\n<p>追求卓越的經營理念，依循穩健的發展方針，</p>\r\n<p>目前己由傳統產業逐漸轉型為國際物流業與建築業，</p>\r\n<p>現物流中心以現代化管理，</p>\r\n<p>提供倉儲、物流、理貨、加工、配送及資訊統合服務，</p>\r\n<p>進而順應時代趨勢，朝向更多元化之網路電子商務整合後勤物流配送系統邁進</p>','stocklogo/1443.png'),(9,'1444','力麗企業','<p><strong>力麗企業</strong>成立於1979年，</p>\r\n<p>所生產之聚酯纖維加工絲，</p>\r\n<p>除供應國內織布廠商作為長纖織物之原料外，</p>\r\n<p>銷售通路亦廣達世界各地。</p>\r\n<p><strong>力麗</strong>全廠區採標準化作業流程並建立自動化生產系統，</p>\r\n<p>品質自動監測與自動落紗、搬運、包裝系統，提升生產效率並減少人為疏失。</p>','stocklogo/1444.png'),(10,'1445','大宇紡織','<p>設立於民國58年9月。</p>\r\n<p>&nbsp;<strong>公司</strong>位於台北市西寧北路62-5號七樓現址(自購)。</p>\r\n<p>織布一廠建於桃園龜山示範工業區、</p>\r\n<p>織布二廠位於桃園縣蘆竹鄉大竹村、</p>\r\n<p>專業假撚廠建於彰化縣鹿港鎮彰濱工業區。</p>','stocklogo/1445.png'),(11,'1447','力鵬企業','<p>成立於1975年，</p>\r\n<p>從紙印花產業起家，並以Transcolor為商標，</p>\r\n<p>於2000年起以生產尼龍粒、尼龍絲、及長纖梭織布為主。&nbsp;</p>\r\n<p><strong>力鵬</strong>尼龍事業具備國際最先進之自動化生產設備，</p>\r\n<p>及一貫化生產流程，並已具有自行獨立設計、建造尼龍聚合廠的核心技術。</p>','stocklogo/1447.png'),(12,'1449','佳和實業','<p><strong>公司</strong>成立於1972年12月，</p>\r\n<p>主要產品為先染織物及長纖織物，</p>\r\n<p>也是少數中游、上游一貫廠，擁有先染及後染廠，</p>\r\n<p>並擁有原料端，極具多元化與客製化產品優勢，</p>\r\n<p>同時也是全球最大的格子布廠。&nbsp;</p>\r\n<p><strong>公司</strong>早期以時裝及傢飾布為主，近年來已逐漸轉型，朝運動、戶外衣飾發展。</p>','stocklogo/1449.png'),(13,'1451','年興紡織','<p>於1986<strong>年</strong>10月成立至今，</p>\r\n<p><strong>年興</strong>已是全世界牛仔布生產量前六大，</p>\r\n<p>同時也是全球最大的一貫化生產的牛仔<strong>紡織</strong>成衣<strong>公司</strong>。</p>\r\n<p>面對瞬息萬變的經營環境，<strong>公司</strong>積極的調整產業發展策略，</p>\r\n<p>配合企業轉型進行多角化經營，升級自動資本設備投資以提升製程效率，</p>\r\n<p>擴大人才培訓計畫，藉由創新設計的團隊引領市場潮流，以持續強化<strong>公司</strong>於國際上之競爭優勢</p>','stocklogo/1451.png'),(14,'1453','大將開發','<p><strong>大將開發股份有限公司</strong>於民國67年設立於台北市，</p>\r\n<p>68年為配合政府獎勵投資條例，</p>\r\n<p>購入雲林縣莿桐鄉<strong>大</strong>埔尾段土地，</p>\r\n<p>與關係企業<strong>大將</strong>建設<strong>開發股份有限公司</strong>共同規劃<strong>開發</strong>成<strong>大將</strong>工業區，</p>\r\n<p>為國內第一家<strong>開發</strong>工業區之民營企業。 為更健全發展，</p>\r\n<p><strong>大將公司</strong>於民國82年在臺灣證券交易所股票掛牌上市，目前登記資本額為新台幣20億元。</p>','stocklogo/1453.png'),(15,'1454','台灣富綢纖維','<p><strong>台灣富綢纖維股份有限公司</strong>，</p>\r\n<p>民國六十二年成立於台北市，</p>\r\n<p>創立實收資本額為新台幣參仟萬元，</p>\r\n<p>初期工廠設於桃園縣八德市以生產聚酯長纖高級衣飾、家飾布料為主，</p>\r\n<p>為一專業織布廠。 民國八十六年在桃園縣富岡新設一專業假撚加工絲廠，本<strong>公司</strong>因而升級為紗、布一貫廠。</p>','stocklogo/1454.png'),(16,'1455','集盛','<p><strong>集盛</strong>實業股份有限公司創立於1969年，</p>\r\n<p>主要從事化材、紡織相關業；</p>\r\n<p>為上市績優廠商並通過ISO9001、GRS.Version 4.0、ISO 14001及ISO 45001認證。</p>\r\n<p>公司於穩定中求發展，現有假撚一、二、三廠；氣撚廠；</p>\r\n<p>尼龍紡絲一、二廠；尼龍聚合一、二、三廠；複合材料廠及<strong>集盛</strong>創新研發中心。</p>','stocklogo/1455.png'),(17,'1456','怡華實業','<p><strong>公司</strong>成立於1968年8月，主要產品包括毛紡紗、棉紗、胚布及成品布等，</p>\r\n<p>和佳和<strong>實業</strong>同屬於佳和集團旗下。&nbsp;</p>\r\n<p><strong>公司</strong>未來將著重在紡織原物料及成品布採購貿易買賣等高附加價值的產品發展。&nbsp;</p>\r\n<p><strong>公司</strong>產品包括棉紗、毛紗、成品布、染料等，2019年營收比重為房地產佔82%、紡織品佔18%。</p>','stocklogo/1456.png'),(18,'1459','聯發紡織纖維','<p>成立於民國61年，以聚酯加工絲為主要生產項目，</p>\r\n<p>全年營業額約新台幣30億元，為一績優<strong>纖維</strong>加工製造類上市<strong>公司</strong>，</p>\r\n<p>目前以本<strong>公司</strong>之規模及產能為全國最大之專業假撚廠，</p>\r\n<p>且2002年7月行政院長參訪本廠時，稱許本<strong>公司</strong>為2008國<strong>發</strong>計劃之模範廠商。</p>','stocklogo/1459.png'),(19,'1460','宏遠興業','<p>創立於1988年，從紗、布、染整至後加工，</p>\r\n<p>係以創新和永續聞名國際的智慧紡織廠。&nbsp;</p>\r\n<p><strong>宏遠</strong>具垂直整合一貫廠的優勢，</p>\r\n<p>從研發、原料、製程到產品，以符合顧客需求為職志，</p>\r\n<p>致力開發對人類及生態無害的紡織品，</p>\r\n<p>推廣「衣的安全」和「穿得健康」理念。</p>','stocklogo/1460.png'),(20,'1464','得力實業','<p>於民國71年成立，從織布代工業務開始，</p>\r\n<p>至今轉為研發導向，主動開發能力獲得客戶的肯定。</p>\r\n<p>主要生產高級長短纖成衣、功能性及家飾布料，</p>\r\n<p>為台灣頗具規模及豐富經驗的生產廠商。</p>\r\n<p>秉持著「勤勞、研究、親和、誠實」的經營理念，</p>\r\n<p>結合客戶長期穩定之共同市場的開拓，研發出少量多樣、精緻化的產品暢銷全球。</p>','stocklogo/1464.png'),(21,'1465','偉全實業','<p>成立於1972年，為股票上市<strong>公司</strong>，</p>\r\n<p>工廠位於桃園蘆竹區和新竹新豐鄉，</p>\r\n<p>我們持續致力在產品研發、掌握流行趨勢、</p>\r\n<p>整合產品供應鏈及提升產品技術和管理素質，</p>\r\n<p>有自有的實驗室，不間斷成長發展及創新，</p>\r\n<p>同時始終考慮到我們的企業、社會和環境責任。</p>','stocklogo/1465.png'),(22,'1466','聚隆纖維','<p>成立於民國77年7月22日，</p>\r\n<p>主要營業產品包括尼龍原絲、<strong>聚</strong>酯原絲、</p>\r\n<p>超細<strong>纖維</strong>複合絲、尼龍加工絲、<strong>聚</strong>酯加工絲、</p>\r\n<p>超細複合加工絲及居家清潔用品系列之終端產品。</p>','stocklogo/1466.png'),(23,'1467','悅達纖維','<p>1978/08本公司創設，成立染紗事業處，資本額新台幣壹仟壹佰捌拾伍萬元。</p>\r\n<p>1996/01設立織布事業處。</p>\r\n<p>1998/12設立成衣事業處。</p>\r\n<p>1998/12股票正式掛牌上市。</p>\r\n<p>1999/10設立墨西哥織布廠及染整廠。</p>','stocklogo/1467.png'),(24,'1469','理隆','<p><strong>公司</strong>成立於1985年8月，為國內最大的花式紗生產商，</p>\r\n<p>能生產上百種以上之不同花式紗，供買方一次購足。&nbsp;</p>\r\n<p><strong>公司</strong>產品以外銷為主，主要客源為歐、美、日市場。</p>\r\n<p>&nbsp;<strong>公司</strong>主要工廠為中壢廠，迄2016年，產能為花式混紡紗171萬磅/年。</p>','stocklogo/1469.png'),(25,'1470','大統精密染','<p><strong>公司</strong>成立於1986年12月，</p>\r\n<p>主要為紡織品及纖維製品之印、漂、<strong>染整</strong>加工</p>\r\n<p>及紗、布、成品布之代工、買賣業務，</p>\r\n<p>主要供作休閒服飾、運動服飾、一般衣著及工業用布等用途。</p>\r\n<p>2018年9月，<strong>公司</strong>更名為<strong>大統</strong>新創<strong>股份有限公司</strong>。</p>','stocklogo/1470.png'),(26,'1471','首利實業','<p><strong>首利實業股份有限公司</strong>為台灣上市<strong>公司</strong>(股票交易代號為1471)。</p>\r\n<p>營運總部位台灣，擁有三座生產基地於中國東莞；</p>\r\n<p>總投資超過新台幣壹拾伍億元。</p>\r\n<p>&nbsp;<strong>首利</strong>整合電子產品研發及機構設計，以優良之研發能力，縮短產品開發時程。</p>','stocklogo/1471.png'),(27,'1472','三洋紡織纖維','<p><strong>公司</strong>成立於1968年10月，</p>\r\n<p>前稱為「<strong>三洋</strong>印染織廠<strong>股份有限公司</strong>」，</p>\r\n<p>後更名為「<strong>三洋紡織纖維股份有限公司</strong>」，</p>\r\n<p>主要產品為尼龍氣撚紗、聚丙烯(PP)<strong>纖維</strong>、針織布及梭織布等，</p>\r\n<p>其中，細丹尼聚丙烯功能性織物取得國際知名廠牌Helly Hansen之訂單。</p>','stocklogo/1472.png'),(28,'1474','弘裕企業','<p>擁有廣泛的產品線，提供布料/紡織品材料，</p>\r\n<p>包括：尼龍布料，聚酯纖維布料（PET），</p>\r\n<p>戶外家飾布（Olefin ），聚丙烯布料（PP），</p>\r\n<p>聚酯短纖布料，乙烯基網眼布料，特斯林網布，</p>\r\n<p>TC / TR布料，原紗染色布料，原抽色紗布料等。</p>','stocklogo/1474.png'),(29,'1475','本盟光電','<p><strong>公司</strong>成立於1982年11月，</p>\r\n<p>為織造、染整一貫作業之提花專業製造商，</p>\r\n<p>亦為國內提花織物的領導廠商。&nbsp;</p>\r\n<p><strong>公司</strong>進一步利用首創的彩色數位提花技術，</p>\r\n<p>透過數位相機或掃描器，將彩色名畫傳送至電腦，</p>\r\n<p>半小時後，彩色的圖案就能在織品重現，為目前全世界首創先驅。</p>','stocklogo/1475.png'),(30,'1476','儒鴻企業','<div class=\"LGOjhe\" data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">1977年成立迄今，專精於功能性圓編彈性針織布與機能性成衣之生產與製作，</div>\r\n<div class=\"LGOjhe\" data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">掌握前端布料研發製造至後端成衣設計製作之ODM生產流程。</div>\r\n<div class=\"LGOjhe\" data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">台灣總部為業務接單、研發創新、技術整合等之運籌中心。</div>\r\n<div class=\"LGOjhe\" data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">生產基地分布於台灣、越南、柬埔寨、及賴索托等地區。</div>','stocklogo/1476.png'),(31,'1477','聚陽實業','<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">公司成立於1990年1月，是亞太地區知名的成衣製造商，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">主要業務為成衣的設計、製造及銷售，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">其客戶為全球及區域型之大型成衣零售商，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">是全球第五大成衣代工商。生產的產品以流行女裝為主，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">包含內睡衣、裙子、洋裝、背心、針織服飾、襯衫、夾克、長短褲、運動套裝等；</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">主要提供的服務包括材質開發、供應商搜尋與管理、款式設計、</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">流行趨勢提供、生產製造、研究開發、物流配送及電子資訊交換等。</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">各項產品的研發與製作均累積無數經驗，能提供客戶多樣產品選擇及一次購足的服務。</div>','stocklogo/1477.png'),(32,'1504','東元電機','<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\"><strong>東元電機</strong>創立於西元1956年，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">初期從事馬達生產，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">至今<strong>東元</strong>集團已跨入重電、家電、資訊、</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">通訊、電子關鍵零組件基礎工程建設、金融投資及餐飲、</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">服務等多面向的發展領域，更積極參與國家重大工程建設，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">目前事業版圖橫跨全球五大洲四十餘國、百餘城市。</div>','stocklogo/1504.png'),(33,'1506','正道工業','<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">正道工業於1964年成立於台灣台南，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">一直為汽車產業及其他工業提供高品質的鑄件與鍛件產品，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">從工程設計到量產的完整產品開發製造服務。</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">集團內主要的生產能力包含鋁合金重力鑄造、</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">HPDC高壓鑄造、鋁合金鍛造、鋼材鍛造、表面處理(陽極、鍍鋅、塗層等處理)以及精密加工等。</div>','stocklogo/1506.png'),(34,'1507','永大機電','<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">永大機電工業股份有限公司創立於1966年7月，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">五十餘年來穩健拓展、銳意創新，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">首開台灣電梯業設計、製造、安裝、保養等全程操作之先河，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">並樹立起台灣第一家本土電梯品牌。沿著踏實的創業足跡，</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">永大的經營版圖迅速從台灣擴展到海外乃至中國大陸。</div>\r\n<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">如今，永大已在全世界許多地方成功建樹恪守信譽又熱誠周到、精益求精且追求完美的永大形象。</div>','stocklogo/1507.png'),(35,'1513','中興電工','<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">\r\n<p>1956年創立，沿著60 年代台灣農業轉為工業的腳印，</p>\r\n<p>開始電動機與發電機的製造，以廠起家，</p>\r\n<p>胼手胝足創立中興大業，隨著台灣經濟的起落，</p>\r\n<p>本公司除多角化經營外，在電力產業亦嶄露頭角，</p>\r\n<p>並以台灣基地打開全球佈局，從研發&mdash;製造&mdash;銷售緊密結合，圖求再創另一高峰。</p>\r\n<p>奠基於目前業務穩健成長之國內重電、工程、停車管理業務，</p>\r\n<p>中興電工將聚焦於發展全球六氟化硫氣體絕緣開關(GIS)</p>\r\n<p>重電設備、製造業務(含五軸龍門機床)及Micro Grid(微電網)等三大業務。</p>\r\n</div>','stocklogo/1513.png'),(36,'1514','亞力電機','<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">\r\n<p>成立於民國57年9月25日,</p>\r\n<p>初期生產低電壓配電盤, 馬達控制中心,</p>\r\n<p>高低壓綜合起動盤, 交直流工業控制設備及輸配電線路用配件.</p>\r\n<p>之後成立生產變壓器, 開關器材和電力電子產品之部門,</p>\r\n<p>提供台電,中油, 電信局, 和其他知名公民營事業機構所需之重電機產品.&nbsp;</p>\r\n</div>','stocklogo/1514.png'),(37,'1515','力山工業','<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">\r\n<p>力山工業股份有限公司於1972年創立於台灣台中，</p>\r\n<p>並於1995年正式於台灣證券交易所上市，</p>\r\n<p>隔年取得ISO9001認證。</p>\r\n</div>','stocklogo/1515.png'),(38,'1516','川飛能源','<div data-attrid=\"wa:/description\" data-hveid=\"CAYQAA\">\r\n<p>川飛能源股份有限公司，成立於民國75年2月，</p>\r\n<p>於84年4月掛牌上市。</p>\r\n<p>公司業務早期為自行車變速器後轉型朝能源事業發展，</p>\r\n<p>規劃發展之主力事業包括再生資源產品買賣、廢棄物代處理及綠色能源等事業。</p>\r\n</div>','stocklogo/1516.png');
